actionConfiguration.body:
(data) => {
		var editedCurrency = data;
		var currencyArray = [];
		for (let i = 0; i < editedCurrency.length; i++) {
			var newCurrency = {
				"id": editedCurrency[i].id,
				"name": editedCurrency[i].name,
				"symbol": editedCurrency[i].symbol,
				"chain_class_id": editedCurrency[i].chain_class_id,
				"chain_asset_id": editedCurrency[i].chain_asset_id,
				"total_supply": editedCurrency[i].total_supply,
				"current_supply": editedCurrency[i].current_supply
			};
			currencyArray.push(newCurrency);
		}
		return currencyArray		
	}

